{"operationName":"stackupBySlug","variables":{"slug":"alfresco-vs-wordpress"},"query":"query stackupBySlug($slug: String!) {
  stackupBySlug(slug: $slug) {
    jobs(first: 8) {
      edges {
        node {
          name
          id
          angellistJobUrl
          title
          location
          services {
            ...serviceFields
            __typename
          }
          company {
            imageUrl
            name
            id
            path
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment serviceFields on Tool {
  id
  name
  slug
  title
  verified
  imageUrl
  canonicalUrl
  path
  votes
  fans
  stacks
  following
  followContext
  __typename
}
"}
